} /* * 计算累积，从 start 到 end, 步长为 1 * * 如果 start > end, 返回 1 */
void cumulate(mpz_t rnt, long start, long end)
{ mpz_set_si(rnt, 1); for (long i = start; i <= end; i++) { /*pro = pro * i;*/ mpz_mul_si(rnt, rnt, i); }
} /* * 计算一个正整数的最优分解问题 * * n 必须为正整数，且小于或等于 LONG_MAX */
void optimal_decomposition(mpz_t rnt, long n)
{ switch (n) { case 1: mpz_set_si(rnt, 0); return; /* 0 * 1 */ case 2: mpz_set_si(rnt, 0); return; /* 0 * 2 */ case 3: mpz_set_si(rnt, 2); return; /* 1 * 2 */ case 4: mpz_set_si(rnt, 3); return; /* 1 * 3 */ } long last, left; get_last_left(&last, &left, n); mpz_t pro; mpz_init(pro); if (last == left) { /* example, n = 13, 3 * 4 * 6 */ cumulate(rnt, 3, last); mpz_mul_si(rnt, rnt, last + 2); } else { /* example, n = 11, 2 * 4 * 5 */ /* (last - 1 - left) 表示未分配到 1 的个数 */ cumulate(pro, 2, 2 + (last - 1 -left) - 1); mpz_set(rnt, pro); cumulate(pro, 2 + (last - 1 - left) + 1, last + 1); mpz_mul(rnt, rnt, pro); } mpz_clear(pro);
}

